import { Link } from "react-router-dom";

const Product = () => {
  const PRODUCTS = [
    { id: "p1", title: "Product-1" },
    { id: "p2", title: "Product-2" },
    { id: "p3", title: "Product-3" },
    { id: "p4", title: "Product-4" },
  ];
  return (
    <>
      <h1>Products</h1>
      <ul>
        {PRODUCTS.map((product) => {
          <li>
            <Link></Link>
          </li>;
        })}
      </ul>
    </>
  );
};
export default Product;
